import { View, Text, TextInput } from 'react-native'
import React from 'react';
import styles from './style';

const Form = () => {
  return (
    <View style={styles.addTask}>
      <TextInput />
      <View>
        <Text>+</Text>
      </View>
    </View>
  )
}

export default Form
